webpackJsonp([0xbb0a9e21d4be],{5123:function(a,e){a.exports={data:{post:{html:'<p>Today is a good day <i>not</i> to drive into Hamburg. The <a href="http://www.hew-cyclassics.de">HEW CyClassics</a> is being held today, and many streets are closed so that the World Cup cyclists can do a couple of laps around Hamburg.</p>\n<p>Rather than risking running into Gabriele Missaglia on his way to winning the World Cup race, we instead took Christopher to the animal park <a href="http://www.wildpark-schwarze-berge.de/">Schwarze Berge</a> (not the same park as we visited in April, but the idea is the same).</p>',fields:{title:"CyClassics",date:"06 Aug 2000",url:"https://papascott.de/2000-08-06-cyclassics/"}}},pathContext:{slug:"/2000-08-06-cyclassics/",prev:{fields:{title:"Laid-up Layout",date:"05 Aug 2000",slug:"/2000-08-05-laid-up-layout/"}},next:{fields:{title:"10 years ago",date:"07 Aug 2000",slug:"/2000-08-07-10-years-ago/"}}}}}});
